import React from 'react';
import styles from './item.module.css';
import classnames from 'classnames'
const Item = ({value,isDone}) => (<span className={
  classnames({
    [styles.item]:true,
    [styles.done]:isDone
    })
}>
  {value}
</span>);
export default Item;
